import NFLPlayer from './NFLPlayer'

const NFLPlayerTableBody = ({ nflPlayers }) => {
  const sortTypes = {
    YdsUp: {
      class: 'yds-up',
      fn: (a, b) => a[Yds] - b.Yds
    },
    YdsDown: {
      class: 'yds-down',
      fn: (a, b) => b.Yds - a.Yds
    },
    LngUp: {
      class: 'lng-up',
      fn: (a, b) => a.Lng - b.Lng
    },
    LngDown: {
      class: 'lng-down',
      fn: (a, b) => b.Lng - a.Lng
    },
    TdUp: {
      class: 'td-up',
      fn: (a, b) => a.TD - b.TD
    },
    TdDown: {
      class: 'td-down',
      fn: (a, b) => b.TD - a.TD
    },
    default: {
      class: 'sort',
      fn: (a,b) => a
    }
  }

  return (
    <tbody>
      {nflPlayers.map((nflPlayer, index) => (
        <NFLPlayer key={index} nflPlayer={nflPlayer} />
      ))}
    </tbody>
  )
}

export default NFLPlayerTableBody
